(15, 11, 'nội dung fb IMG-Learning + Edu', NULL, 'in_progress', 29, '2022-06-14 00:00:00', '2022-06-30 00:00:00', '<p>img learning cập nhật b&agrave;i viết h&agrave;ng ng&agrave;y (1 tuần thay ảnh b&igrave;a 1 lần)</p>\r\n<p>Img-edu trong th&aacute;ng 6 đủ c&aacute;c b&agrave;i viết về chủ đề deepwork</p>\r\n<p>+Deepwork l&agrave; g&igrave; (tập trung s&acirc;u)</p>\r\n<p>+Deepwork gi&uacute;p g&igrave; cho trẻ em học tập</p>\r\n<p>+C&aacute;ch để đạt được trang th&aacute;i deepwork d&agrave;nh cho học sinh cấp 2 -3</p>\r\n<p>+Phương ph&aacute;p l&agrave;m việc (học tập) Pomodoro</p>\r\n<p>+10 điều cần tr&aacute;nh gi&uacute;p đạt được trạng th&aacute;i deepwork khi l&agrave;m việc</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 29, '{\"enable_timelog\":1,\"enable_invoice\":1,\"enable_notes_documents\":1,\"members_crud_task\":0,\"members_crud_note\":0,\"members_crud_timelog\":0,\"task_view\":\"list_view\",\"task_id_prefix\":\"#\"}', '2022-06-14 07:09:54', '2022-06-14 07:09:54', NULL, 0),
